import React from 'react'
import { Carousel } from 'react-bootstrap'
import './Home.css'
import img1 from './img/p4.jpg'
import img2 from './img/p2.jpg'
import img3 from './img/p3.jpg'
import Cardset from '../Cardset/Cardset'
import ImagesData from '../BooksImagesData/Images.json';


function Home() {
    let images: any = ImagesData;
    console.log(ImagesData)


    return (
        <div className="home__container">
            <Carousel>

                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src={img1}
                        alt="Third slide"
                    />

                </Carousel.Item>


                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src={img2}
                        alt="Third slide"
                    />

                </Carousel.Item>

                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src={img3}
                        alt="Third slide"
                    />
                </Carousel.Item>
            </Carousel>

            {/* //////////////////////////////////////////////////////////////////////////////// */}

            <div className="container-fluid nav_bg" >
                <div className="row" >
                    {/* <div className="col-10 mx-auto" > */}
                    {
                        images.map((Image: String, ind: string | number | null | undefined) => {
                            let author:tring = Image.author;
                            // let image = Image.img.toString();
                            return (
                                <Cardset
                                    key={ind}
                                    author={author}
                                />
                            )
                        })
                    }
                    {/* </div> */}
                </div>
            </div>





        </div >
    )
}

export default Home
